import React, { Component } from "react";
class Items extends Component {
  render() {
    const countries =
      this.props.state.searchedCountries.length !== 0
        ? this.props.state.searchedCountries
        : this.props.state.countries;
    return (
      <StyledHome>
        {countries && <Filters />}
        <CountryWrapper>
          {countries &&
            countries.map((el, index) => (
              <List_element country={el} id={index} key={index}>
                {el.name}
              </List_element>
            ))}
        </CountryWrapper>
      </StyledHome>
    );
  }
}
export default Items;
